CREATE TYPE admin_type AS ENUM ('Collaborator', 'Technician');
CREATE TYPE order_state_type AS ENUM (
    'Shopping Cart',
    'Pending',
    'In Progress',
    'Completed',
    'Cancelled'
);
CREATE TYPE notification_type AS ENUM (
    'New Promotion',
    'New Collection',
    'Recommended Product',
    'Change in Order State',
    'Payment accept',
    'Product in Wishlist Available',
    'Price Change of Item in Shopping Cart',
    'Order',
    'Report',
    'Other'
);

CREATE TABLE image (
    id SERIAL PRIMARY KEY,
    file TEXT NOT NULL CONSTRAINT image_unique UNIQUE
);
CREATE TABLE authenticated_user (
    id SERIAL PRIMARY KEY,
    first_name TEXT NOT NULL,
    last_name TEXT NOT NULL,
    email TEXT NOT NULL UNIQUE,
    password TEXT NOT NULL,
    birth_date DATE,
    gender TEXT,
    blocked BOOLEAN NOT NULL DEFAULT FALSE,
    remember_token TEXT,
    id_image INTEGER REFERENCES image(id) ON UPDATE CASCADE ON DELETE SET NULL
);
CREATE TABLE admin(
    id SERIAL PRIMARY KEY,
    first_name TEXT NOT NULL,
    last_name TEXT NOT NULL,
    email TEXT NOT NULL UNIQUE,
    password TEXT NOT NULL,
    birth_date DATE,
    gender TEXT,
    id_image INTEGER REFERENCES image(id) ON UPDATE CASCADE ON DELETE SET NULL,
    remember_token TEXT,
    role admin_type NOT NULL
);

CREATE TABLE notifications (
    id CHAR(36) PRIMARY KEY,
    type VARCHAR(255) NOT NULL,
    notifiable_id INT NOT NULL,
    notifiable_type VARCHAR(255) NOT NULL,
    data TEXT NOT NULL,
    read_at TIMESTAMP NULL DEFAULT NULL,
    created_at TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
    updated_at TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP
);


CREATE TABLE card(
    id SERIAL PRIMARY KEY,
    nickname TEXT,
    name TEXT NOT NULL,
    number TEXT NOT NULL CONSTRAINT cart_unique UNIQUE,
    month int NOT NULL,
    year int NOT NULL,
    code TEXT NOT NULL,
    id_user INTEGER NOT NULL REFERENCES authenticated_user(id) ON UPDATE CASCADE ON DELETE CASCADE
);
CREATE TABLE country(
    id SERIAL PRIMARY KEY,
    name TEXT NOT NULL CONSTRAINT country_unique UNIQUE
);
CREATE TABLE address(
    id SERIAL PRIMARY KEY,
    name TEXT NOT NULL,
    company TEXT,
    nif TEXT,
    street TEXT NOT NULL,
    number int NOT NULL,
    apartment TEXT,
    note TEXT,
    id_country INTEGER NOT NULL REFERENCES country(id) ON UPDATE CASCADE,
    id_user INTEGER REFERENCES authenticated_user(id) ON UPDATE CASCADE ON DELETE SET NULL
);
CREATE TABLE category(
    id SERIAL PRIMARY KEY,
    name TEXT NOT NULL,
    id_super_category INTEGER REFERENCES category(id) ON UPDATE CASCADE ON DELETE SET NULL
);
CREATE TABLE product(
    id SERIAL PRIMARY KEY,
    name TEXT NOT NULL CONSTRAINT product_unique UNIQUE,
    description TEXT,
    price NUMERIC NOT NULL,
    avg_classification NUMERIC,
    id_category INTEGER NOT NULL REFERENCES category(id) ON UPDATE CASCADE
);
CREATE TABLE product_image(
    id_product INTEGER NOT NULL REFERENCES product(id) ON UPDATE CASCADE ON DELETE CASCADE,
    id_image INTEGER NOT NULL REFERENCES image(id) ON UPDATE CASCADE ON DELETE CASCADE,
    PRIMARY KEY (id_product, id_image)
);
CREATE TABLE wishlist(
    id_user INTEGER NOT NULL REFERENCES authenticated_user(id) ON UPDATE CASCADE ON DELETE CASCADE,
    id_product INTEGER NOT NULL REFERENCES product(id) ON UPDATE CASCADE ON DELETE CASCADE
);
CREATE TABLE review(
    id SERIAL PRIMARY KEY,
    evaluation int NOT NULL CHECK (
        evaluation > 0
        AND evaluation <= 5
    ),
    title TEXT NOT NULL,
    description TEXT NOT NULL,
    date TIMESTAMP NOT NULL,
    id_user INTEGER REFERENCES authenticated_user(id) ON UPDATE CASCADE ON DELETE SET NULL,
    id_product INTEGER NOT NULL REFERENCES product(id) ON UPDATE CASCADE ON DELETE CASCADE
);
CREATE TABLE user_like(
    id_user INTEGER REFERENCES authenticated_user(id) ON UPDATE CASCADE ON DELETE CASCADE,
    id_review INTEGER NOT NULL REFERENCES review(id) ON UPDATE CASCADE ON DELETE CASCADE,
    PRIMARY KEY (id_user, id_review)
);
CREATE TABLE report(
    id SERIAL PRIMARY KEY,
    description TEXT NOT NULL,
    resolved boolean NOT NULL DEFAULT FALSE,
    report_date TIMESTAMP NOT NULL,
    id_review INTEGER REFERENCES review(id) ON UPDATE CASCADE ON DELETE CASCADE,
    id_user INTEGER REFERENCES authenticated_user(id) ON UPDATE CASCADE ON DELETE SET NULL
);
CREATE TABLE promotion(
    id SERIAL PRIMARY KEY,
    discount NUMERIC NOT NULL CHECK (
        discount > 0
        AND discount < 100
    ),
    start_date  TIMESTAMP NOT NULL,
    final_date TIMESTAMP NOT NULL CHECK (final_date > start_date)
);
CREATE TABLE promotion_product(
    id_promotion INTEGER NOT NULL REFERENCES promotion(id) ON UPDATE CASCADE ON DELETE CASCADE,
    id_product INTEGER NOT NULL REFERENCES product(id) ON UPDATE CASCADE ON DELETE CASCADE,
    PRIMARY KEY (id_promotion, id_product)
);
CREATE TABLE size(
    id SERIAL PRIMARY KEY,
    name TEXT NOT NULL CONSTRAINT size_unique UNIQUE
);
CREATE TABLE color(
    id SERIAL PRIMARY KEY,
    name TEXT NOT NULL CONSTRAINT color_unique UNIQUE
);
CREATE TABLE stock(
    stock int NOT NULL CHECK (stock >= 0),
    id_product INTEGER NOT NULL REFERENCES product(id) ON UPDATE CASCADE ON DELETE CASCADE,
    id_size INTEGER NOT NULL REFERENCES size(id) ON UPDATE CASCADE ON DELETE CASCADE,
    id_color INTEGER NOT NULL REFERENCES color(id) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE user_order(
    id SERIAL PRIMARY KEY,
    status order_state_type NOT NULL DEFAULT 'Shopping Cart',
    date TIMESTAMP NOT NULL,
    id_user INTEGER REFERENCES authenticated_user(id) ON UPDATE CASCADE ON DELETE SET NULL,
    id_address INTEGER REFERENCES address(id) ON UPDATE CASCADE ON DELETE SET NULL,
    id_card INTEGER REFERENCES card(id) ON UPDATE CASCADE ON DELETE SET NULL
);

CREATE TABLE details(
    id SERIAL PRIMARY KEY,
    quantity int NOT NULL CHECK (quantity >= 0),
    id_product INTEGER NOT NULL REFERENCES product(id) ON UPDATE CASCADE ON DELETE CASCADE,
    id_size INTEGER NOT NULL REFERENCES size(id) ON UPDATE CASCADE ON DELETE CASCADE,
    id_color INTEGER NOT NULL REFERENCES color(id) ON UPDATE CASCADE ON DELETE CASCADE,
    id_order INTEGER NOT NULL REFERENCES user_order(id) ON UPDATE CASCADE ON DELETE CASCADE
);

CREATE TABLE password_resets(
    email TEXT PRIMARY KEY,
    token TEXT NOT NULL,
    created_at TIMESTAMP
);
