CREATE INDEX user_first_name_idx ON authenticated_user USING btree (first_name);

--FULL-TEXT SEARCH INDICES

-- Full-text search indice (e trigger para suporte) na tabela product
-- nos atributos name e description

ALTER TABLE product
ADD COLUMN tsvectors TSVECTOR;

CREATE FUNCTION product_search()
RETURNS TRIGGER AS $$
BEGIN
    IF TG_OP = 'INSERT'
    THEN
        NEW.tsvectors = (
            setweight(to_tsvector('english', NEW.name), 'A') ||
            setweight(to_tsvector('english', NEW.description), 'B')
        );
    END IF;
    IF TG_OP = 'UPDATE'
    THEN
        IF (NEW.name <> OLD.name OR NEW.description <> OLD.description)
        THEN
            NEW.tsvectors = (
                setweight(to_tsvector('english', NEW.name), 'A') ||
                setweight(to_tsvector('english', NEW.description), 'B')
            );
        END IF;
    END IF;
    RETURN NEW;
END; $$
LANGUAGE plpgsql;

CREATE TRIGGER product_search_update
BEFORE INSERT OR UPDATE ON product
FOR EACH ROW
EXECUTE PROCEDURE product_search();

CREATE INDEX search_idx ON product USING GIN (tsvectors);


--TRIGGERS and User Defined Functions

-- check product combination

CREATE FUNCTION check_product_combination()
RETURNS trigger as
$$BEGIN
    IF NOT EXISTS (SELECT * FROM stock WHERE id_product = NEW.id_product and id_size = new.id_size and id_color = new.id_color)
    THEN
        RAISE EXCEPTION 'The color, size and product combination you want does not exist!';
    END IF;
    RETURN NEW;
END; $$
LANGUAGE plpgsql;

CREATE TRIGGER check_product_combination
BEFORE insert ON details
FOR EACH ROW
EXECUTE PROCEDURE check_product_combination();

-- Update classfication

CREATE FUNCTION update_avg_classification_product()
RETURNS TRIGGER AS
$$BEGIN
    UPDATE product SET avg_classification = (
        SELECT avg(evaluation)
        FROM review
        WHERE id_product = NEW.id_product
    ) WHERE id = NEW.id_product;
    RETURN NEW;
END; $$
LANGUAGE plpgsql;

CREATE TRIGGER update_avg_classification_product
AFTER INSERT ON review
FOR EACH ROW
EXECUTE PROCEDURE update_avg_classification_product(); 

-- Number Shopping Carts

create function check_num_shopping_cart()
returns trigger as
$$BEGIN
    if (select count(*) from user_order where id_user = new.id_user and status = 'Shopping Cart') >= 1
    THEN
        RAISE EXCEPTION 'A user cannot have two active carts';
    end if;
    return new;
END; $$
LANGUAGE plpgsql;

create trigger check_num_shopping_cart
before insert on user_order
for each row
EXECUTE PROCEDURE check_num_shopping_cart();

-- Verify card

CREATE FUNCTION check_card_order()
RETURNS TRIGGER AS 
$$BEGIN
    IF NOT EXISTS (SELECT * FROM user_order NATURAL JOIN card WHERE id_user = NEW.id_user AND id_card = NEW.id_card) AND new.id_card <> NULL
    THEN
        RAISE EXCEPTION 'The card does not belong to the user';
    END IF;
    RETURN NEW;
END; $$
LANGUAGE plpgsql;

CREATE TRIGGER check_card_order
BEFORE UPDATE ON user_order
FOR EACH ROW
EXECUTE PROCEDURE check_card_order();

-- Verify address

CREATE FUNCTION check_address_order()
RETURNS TRIGGER AS 
$$BEGIN
    IF NOT EXISTS (SELECT * FROM user_order NATURAL JOIN address WHERE  id_user = NEW.id_user AND id_address = NEW.id_address) AND new.id_address <> NULL
    THEN
        RAISE EXCEPTION 'The address does not belong to the user';
    END IF;
    RETURN NEW;
END; $$
LANGUAGE plpgsql;

CREATE TRIGGER check_address_order
BEFORE UPDATE ON user_order
FOR EACH ROW
EXECUTE PROCEDURE check_address_order();


-- Ao apagar a conta de um utilizador toda a informação partilhada (encomendas, gostos, reviews) é mantida

CREATE FUNCTION delete_user_information()
RETURNS TRIGGER AS
$$ BEGIN
    UPDATE report SET id_user = NULL WHERE id_user = OLD.id;
    UPDATE review SET id_user = NULL WHERE id_user = OLD.id;
    UPDATE user_like SET id_user = NULL WHERE id_user = OLD.id;
    DELETE FROM wishlist WHERE id_user = OLD.id;
    UPDATE user_order SET id_user = NULL,
                          id_address = NULL,
                          id_card = NULL
                          WHERE id_user = OLD.id;
    RETURN OLD;
END; $$
LANGUAGE plpgsql;

CREATE TRIGGER delete_user_account
AFTER DELETE ON authenticated_user
FOR EACH ROW
EXECUTE PROCEDURE delete_user_information();

-- Verificar se um utilizador já comprou o produto antes de fazer uma review

CREATE FUNCTION check_review_privileges()
RETURNS TRIGGER AS
$$ BEGIN
    IF NOT EXISTS (SELECT * FROM user_order NATURAL JOIN details WHERE status = 'Completed' AND id_user = NEW.id_user AND id_product = NEW.id_product)
    THEN
        RAISE EXCEPTION 'An item can only be reviewed if it has been purchased';
    END IF;
    RETURN NEW;
END; $$
LANGUAGE plpgsql;

CREATE TRIGGER before_review_insert
BEFORE INSERT ON review
FOR EACH ROW
EXECUTE PROCEDURE check_review_privileges();

-- O utilizador não pode meter um like na própia review


CREATE FUNCTION check_like_privileges()
RETURNS TRIGGER AS
$$ BEGIN
    IF EXISTS (SELECT id_user
               FROM review
               WHERE id = NEW.id_review AND id_user = NEW.id_user)
    THEN
        RAISE EXCEPTION 'A user cannot like his own review';
    END IF;
    RETURN NEW;
END; $$
LANGUAGE plpgsql;

CREATE TRIGGER before_like_insert
BEFORE INSERT ON user_like
FOR EACH ROW
EXECUTE PROCEDURE check_like_privileges();


-- Um utilizador não pode reportar a sua review


CREATE FUNCTION check_report_privileges()
RETURNS TRIGGER AS
$$ BEGIN
    IF EXISTS (SELECT id_user
               FROM review
               WHERE id = NEW.id_review AND id_user = NEW.id_user)
    THEN
        RAISE EXCEPTION 'A user cannot report his own review';
    END IF;
    RETURN NEW;
END; $$
LANGUAGE plpgsql;

CREATE TRIGGER before_report_insert
BEFORE INSERT ON report
FOR EACH ROW
EXECUTE PROCEDURE check_report_privileges();


-- verificar se uma order com estado diferente de "Shopping Cart" tem todos os parametros preenchidos

CREATE FUNCTION order_parameters()
RETURNS TRIGGER AS
$$ BEGIN
    IF (OLD.status = 'Shopping Cart' AND NEW.status <> 'Shopping Cart')
    THEN
        IF NEW.id_user IS NULL OR NEW.id_address IS NULL OR NEW.id_card IS NULL
        THEN
            RAISE EXCEPTION 'Order must have an user, an address and a card';
        END IF;
    END IF;
    RETURN NEW;
END; $$
LANGUAGE plpgsql;

CREATE TRIGGER check_order_parameters
BEFORE UPDATE ON user_order
FOR EACH ROW
EXECUTE PROCEDURE order_parameters();

